static const uint8_t key128[] = {0x00, 0x01, 0x02, 0x03, 0x04, 0x05, 0x06, 0x07, 0x08, 0x09, 0x0a, 0x0b, 0x0c, 0x0d,
                                 0x0e, 0x0f};

TEST(Cipher, crypt) {
    uint8_t orig[] = {0x00, 0x11, 0x22, 0x33, 0x44, 0x55, 0x66, 0x77, 0x88, 0x99, 0xaa, 0xbb, 0xcc, 0xdd, 0xee, 0xff};
    Cipher cipher(key128, 16);
    cipher.crypt(orig);
    uint8_t expected[] = {0x69, 0xc4, 0xe0, 0xd8, 0x6a, 0x7b, 0x04, 0x30, 0xd8, 0xcd, 0xb7, 0x80, 0x70, 0xb4, 0xc5,
                          0x5a};
    for (uint8_t a = 0; a < 16; a++)
        EXPECT_EQ(orig[a], expected[a]);
}

TEST(Cipher, decrypt) {
    uint8_t orig[] = {0x69, 0xc4, 0xe0, 0xd8, 0x6a, 0x7b, 0x04, 0x30, 0xd8, 0xcd, 0xb7, 0x80, 0x70, 0xb4, 0xc5, 0x5a};
    uint8_t exp[] = {0x00, 0x11, 0x22, 0x33, 0x44, 0x55, 0x66, 0x77, 0x88, 0x99, 0xaa, 0xbb, 0xcc, 0xdd, 0xee, 0xff};
    Cipher cipher(key128, 16);
    cipher.decrypt(orig);
    for (uint8_t a = 0; a < 16; a++)
        EXPECT_EQ(orig[a], exp[a]);
}

TEST(Chipher, cryptingAgain) {
    uint8_t exp_orig[] = {0x49, 0x20, 0x77, 0x6f, 0x6e, 0x27, 0x74, 0x20, 0x61, 0x72, 0x67, 0x75, 0x65, 0x2c, 0x20,
                          0x49};
    uint8_t exp_crypt[] = {0xa7, 0x1f, 0x44, 0x9b, 0x1a, 0x01, 0x5a, 0xab, 0x95, 0x92, 0xb0, 0x57, 0x0c, 0xf9, 0xc7,
                           0xa2};
    uint8_t orig[] = {ROWS_355, ROWS_355, ROWS_355, ROWS_355,
                      ROWS_355, ROWS_355, ROWS_355, ROWS_355,
                      ROWS_355, ROWS_355, ROWS_355, ROWS_355,
                      ROWS_355, ROWS_355, ROWS_355, ROWS_355};
    Cipher cipher(key128, 16);
    auto start = std::chrono::high_resolution_clock::now();
    for (size_t a = 0; a < 355 * 16; a++)
        cipher.crypt(&orig[a * 16]);
    auto elapsed = std::chrono::high_resolution_clock::now() - start;
    std::cout << "-----test crypt time: " << std::chrono::duration_cast<std::chrono::microseconds>(elapsed).count()
              << " us" << std::endl;
    for (uint8_t a = 0; a < 16; a++)
        EXPECT_EQ(orig[a], exp_crypt[a]);
    cipher.decrypt(orig);
    for (uint8_t a = 0; a < 16; a++)
        EXPECT_EQ(orig[a], exp_orig[a]);
}
